import React from 'react';
import Header from './Header';
import '../CSS/Homepage.css'

const Homepage = ({ toggleSidebar, sidebarClassName }) => {

  return (
    <React.Fragment>
      <Header toggleSidebar={toggleSidebar} sidebarClassName={sidebarClassName} heading="Homepage" />
      <main>Homepage</main>
    </React.Fragment>
  );
};

export default Homepage;
